import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monster1: {
        name: 'Linda',
      },
      monster2: {
        name: 'Roy',
      },
      monster3: {
        name: 'Jacky',
      },
    };
  }

  changeNameHandler() {
    this.setState({ name: 'Roy Chan' });
  }

  render() {
    return (
      <div className='App'>
        {this.state.map((monster) => (
          <p1>monster.name</p1>
        ))}
      </div>
    );
  }
}

export default App;
